VALUES ('3350033366992', 'Fusilli de pois cassés', 'SPÉCIALITÉ DE FARINE DE POIS CASSÉS SANS GLUTEN, RICHE EN FIBRES, EN PROTÉINES ET NATURELLEMENT PAUVRE EN SUCRES Les Fusili de cassés Monoprix, naturellement pauvres en sucres, allient des apports riches en protéines et en fibres. Ils sont également garantis sans gluten. Le gluten est un constituant protéique présent dans le blé (froment. épeautre, petit épeautre, Kamut\'), rorge, le seigle et dans certains cas ravoine. Linto!érance au gluten entraine une malabsorption intestinale. Une personne mto!érante au gluten doit proscrire de manière stricte tous les afiments contenant ces céréales ou leurs dérivés. Ces FISiI}i conviennent aux personnes intolérantes au gluten. Ils peuvent bien sûr être consommés par toute la famille avec leur texture al dente et leur saveur légèrement sucrée typique du pois cassé.', '2.2', '0.5', '55', '2.4', '7.5', '22', '0.14', '0.0551181102362205', '', '1');

